struct node
{
    int a,b;
};
node getprime(int i)
{
    int ousq=1,insq=1;
    int j=sqrt(i);
    int ls=i;
    for(;j>=1;j--)
    {
        if(ls%(j*j)==0)
            ousq*=j,ls/=(j*j);
    }
    int ret=i/ousq/ousq;
    insq=ret;
    node s;
    s.a=insq,s.b=ousq;
    return s;
}
